lens_1.query:
q = load "${App.Datasets.OpptyProducts_Amills_EasyMigrate_tp.FullyQualifiedName}";
q = group q by 'Product_Name';
q = foreach q generate 'Product_Name' as 'Product_Name', avg('Discount_Percent') as 'Peer Purchasers', avg('Discount_Percent')/3*100 as 'Days to Expiration';
q = filter q by 'Peer Purchasers' >= 0.1829863082930544 && 'Peer Purchasers' <= 0.4748454039143116;
q = order q by 'Peer Purchasers' desc;
q = limit q 2000;

lens_2.query:
q = load "${App.Datasets.OpptyProducts_Amills_EasyMigrate_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate avg('Discount_Percent')+.7225 as 'NPS';
q = limit q 2000;
